import "./navBar.css";

export default function NavBar(props) {
  const { menuItems, logo } = props;

  const mockMenuItems = {
    Link1: "/link1",
    Link2: "/link2",
    Link3: "/link3",
  };

  return <div className="navBar"></div>;
}
